webpackJsonp([43100628074981],{1032:function(e,t){e.exports={data:{allPostTitles:{edges:[{node:{frontmatter:{title:"Contributing",group:"Internals",type:"doc"},fields:{slug:"/contributing"}}},{node:{frontmatter:{title:"Create a New Admin User",group:"Advanced Usage",type:"doc"},fields:{slug:"/create-a-new-admin-user"}}},{node:{frontmatter:{title:"Get Started",group:"Basic Usage",type:"doc"},fields:{slug:"/get-started"}}},{node:{frontmatter:{title:"Set up Custom Domain",group:"Advanced Usage",type:"doc"},fields:{slug:"/set-up-custom-domain"}}},{node:{frontmatter:{title:"Cost Estimate",group:"Internals",type:"doc"},fields:{slug:"/cost-estimate"}}},{node:{frontmatter:{title:"Set up Custom HTTP(S) Monitoring",group:"Advanced Usage",type:"doc"},fields:{slug:"/set-up-custom-http-s-monitoring"}}},{node:{frontmatter:{title:"Set up the development environment",group:"Internals",type:"doc"},fields:{slug:"/set-up-the-development-environment"}}},{node:{frontmatter:{title:"Integrate with Other Monitoring Systems",group:"Advanced Usage",type:"doc"},fields:{slug:"/integrate-with-other-monitoring-systems"}}},{node:{frontmatter:{title:"Supported AWS Regions",group:"Basic Usage",type:"doc"},fields:{slug:"/supported-aws-regions"}}},{node:{frontmatter:{title:"Upgrading LambStatus",group:"Basic Usage",type:"doc"},fields:{slug:"/upgrading-lamb-status"}}},{node:{frontmatter:{title:"Set up Email Notification",group:"Advanced Usage",type:"doc"},fields:{slug:"/set-up-email-notification"}}}]},postBySlug:{html:'<p>This page tells you how to add a new admin user to manage your status page. LambStatus depends on Amazon Cognito to manage admin users. A new user will have the same priviledges as the user created at the launch of the stack.</p>\n<ol>\n<li>\n<p>Open \'the Amazon Cognito Console\' at first. Easy way to do this is to open the \'Users\' tab of the admin page and click the link in the text.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 790px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 37.27034120734908%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="CreateUser1"\n        title=""\n        src="/LambStatus-website/static/CreateUser1-643f46bea72bc2d905754edb8df42200-ffc88.png"\n        srcset="/LambStatus-website/static/CreateUser1-643f46bea72bc2d905754edb8df42200-d16f8.png 198w,/LambStatus-website/static/CreateUser1-643f46bea72bc2d905754edb8df42200-f21b1.png 395w,/LambStatus-website/static/CreateUser1-643f46bea72bc2d905754edb8df42200-ffc88.png 790w,/LambStatus-website/static/CreateUser1-643f46bea72bc2d905754edb8df42200-81e7e.png 1185w,/LambStatus-website/static/CreateUser1-643f46bea72bc2d905754edb8df42200-7cfeb.png 1580w,/LambStatus-website/static/CreateUser1-643f46bea72bc2d905754edb8df42200-7860c.png 2286w"\n        sizes="(max-width: 790px) 100vw, 790px"\n      />\n    </span>\n  </span>\n  </p>\n</li>\n<li>\n<p>Click the \'Create user\' button.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 790px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 46.01593625498008%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="CreateUser2"\n        title=""\n        src="/LambStatus-website/static/CreateUser2-8e9e3de3c73be005c5461c21940b1018-ffc88.png"\n        srcset="/LambStatus-website/static/CreateUser2-8e9e3de3c73be005c5461c21940b1018-d16f8.png 198w,/LambStatus-website/static/CreateUser2-8e9e3de3c73be005c5461c21940b1018-f21b1.png 395w,/LambStatus-website/static/CreateUser2-8e9e3de3c73be005c5461c21940b1018-ffc88.png 790w,/LambStatus-website/static/CreateUser2-8e9e3de3c73be005c5461c21940b1018-81e7e.png 1185w,/LambStatus-website/static/CreateUser2-8e9e3de3c73be005c5461c21940b1018-7cfeb.png 1580w,/LambStatus-website/static/CreateUser2-8e9e3de3c73be005c5461c21940b1018-004dc.png 2008w"\n        sizes="(max-width: 790px) 100vw, 790px"\n      />\n    </span>\n  </span>\n  </p>\n</li>\n<li>\n<p>Enter a username and email. Also, check the \'Email\' to send an invitation and UNcheck the \'Mark phone number as verified?\' to prevent an error. Then, click the \'Create user\' button.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 790px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 84.26966292134831%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="CreateUser3"\n        title=""\n        src="/LambStatus-website/static/CreateUser3-22a3743b33fccf2553310eecd7c1e98b-ffc88.png"\n        srcset="/LambStatus-website/static/CreateUser3-22a3743b33fccf2553310eecd7c1e98b-d16f8.png 198w,/LambStatus-website/static/CreateUser3-22a3743b33fccf2553310eecd7c1e98b-f21b1.png 395w,/LambStatus-website/static/CreateUser3-22a3743b33fccf2553310eecd7c1e98b-ffc88.png 790w,/LambStatus-website/static/CreateUser3-22a3743b33fccf2553310eecd7c1e98b-81e7e.png 1185w,/LambStatus-website/static/CreateUser3-22a3743b33fccf2553310eecd7c1e98b-5fdf9.png 1246w"\n        sizes="(max-width: 790px) 100vw, 790px"\n      />\n    </span>\n  </span>\n  </p>\n</li>\n<li>\n<p>The email will be sent to the new user. Now the new user can sign in the admin page!</p>\n</li>\n</ol>',timeToRead:1,excerpt:"This page tells you how to add a new admin user to manage your status page. LambStatus depends on Amazon Cognito to manage admin users. Aâ€¦",frontmatter:{title:"Create a New Admin User"},fields:{slug:"/create-a-new-admin-user"}}},pathContext:{slug:"/create-a-new-admin-user"}}}});
